    const [data, setData] = useState([{}])

    userEffect(() => {
        fetch('/').then(
            res = res.json()
        ).then(
            data => {
                setData(data)
                console.log()
            }
        )
    })
    return (
        <div>
        </div>
    )
}

export default App
